import React from 'react'
import useTranslation from '../hooks/useTranslation'
import Link from 'next/link'

export const Home = () => {
  const { t } = useTranslation()
  const paragraph = t('about')

  return (
    <>
      <h1>{t('hello')}</h1>
      <h2>{paragraph}</h2>

      <p>
        <Link href="/about">
          <a>About</a>
        </Link>
      </p>
    </>
  )
}
